import * as React from 'react';
import Box from '@mui/material/Box';
import { Toolbar, Typography } from '@mui/material';
export default function BoxSystemProps({ job }) {
  return (
    <Box
      height={200}
      width={300}
      my={5}
      display="flex"
      alignItems="center"
      flexDirection="column"
      gap={2}
      p={2}
      bac
      marginLeft={5}
      borderRadius={3}
      sx={{ border: '2px solid grey' }}
    >
    <Typography
      textAlign="center"
      color="#fff"
    >
      {job.title}
    </Typography>
    <Typography
      color="#fff"
    >
      {job.description}
    </Typography>?
    </Box>
  );
}
